import React from 'react';
import { 
  LineChart, 
  Line 
} from 'recharts';

const MyLineChart = (props) => {
  // console.log(props.data)
  return (
    <LineChart
      width={640}
      height={480}
      data={props.data}
    >
      <Line 
        type="monotone" 
        dataKey="engagement_level" 
        stroke="#f5f5f5" 
        strokeWidth='2'
        isAnimationActive={false}
        dot={false}
      />
      <YAxis domain={[0, 'dataMax + 1000']} allowDataOverflow={true} />
    </LineChart>
  );
};

export default MyLineChart;
